INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700125755', 'Cônes Pistache-Chcolat', 'Glace à la pistache 33,9% : eau ; _lait_ écrémé reconstitué ; sirop de glucose-fructose ; _lactose_ et protéines de _lait_ ; graisse végétale de coprah ; sucre ; pâte de pistache 3% ; extrait de carthame et d\'algue ; arôme naturel de pistache avec autres arômes naturels ; émulsifiant : E471 ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes ; colorant : curcumine. (% exprimé sur la glace à la pistache). Glace au chocolat 32,4% : _lait_ écrémé reconstitué ; eau ; sirop de glucose-fructose ; _lactose_ et protéines de _lait _; sucre ; graisse végétale de coprah ; chocolat 3% (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithines (_soja_)) ; cacao en poudre ; pâte de cacao ; cacao maigre en poudre ; émulsifiant : E471 ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes. (% exprimé sur la glace au chocolat). Cornet biscuit 15,5% : farine de _blé_, sucre, graisse végétale de coprah, émulsifiant : lécithines (_soja_). Chemisage (intérieur cône) au cacao maigre 7% : graisses végétales (palmiste, palme), sucre, cacao maigre en poudre 10%, émulsifiant : lécithines (_soja_) (% exprimé sur le chemisage). Pointe fourrée au cacao maigre et noisette 4,2 % : graisse végétale œ copain, sucre, cacao maigre en poudre 10%, pâte de _noisette_ 5%, émulsifiant : lécithines (_soja_), arômes naturels, sel. (% exprimés sur la pointe fourrée). Décor au cacao maigre 2,8% : graisses végétales (coprah, Éî), sucre, cacao maigre en poudre 15%, émulsifiant : lécithines (_soja_). (% exprimé sur le décor au cacao maigre). Morceaux de nougatine (décor) 2,8% : sucre, _amandes_ 30%. (% exprimé sur les morceaux de nougatine). Pépites de chocolat (inclusions) 1,4% : sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithines (_soja_).', 'https://static.openfoodfacts.org/images/products/356/470/012/5755/front_fr.6.400.jpg', '15.4', '11.6', '40.3', '29.4', '1.7', '3.7', '0.075', '0.0295275590551181', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700125793', 'Smicy Vanille Chocolat', 'Glace à la vanille 34,3% : lait écrémé reconstitué ; sirop de glucose-fructose ; concentré de protéines de lactosérum ; eau ; graisse de coprah ; sucre ; arôme naturel de vanille ; émulsifiant : E471 ? stabilisants : farine de graines de caroube, gomme guar, carraghénanes ; gousses de vanille épuisées et broyées ; colorant : rocou. Glace au chocolat 34,3% : lait écrémé reconstitué ; sucre ; graisse de coprah ; chocolat 1,37 % (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithines (soja)) ; cacao maigre en poudre 1,2% ; sirop de glucose-fructose ; lait écrémé concentré ; dextrose ; émulsifiant : E471 ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes. Cornet biscuit 16,4% : farine de blé, sucre, graisse de coprah, émulsifiant : lécithines (soja). Chemisage (intérieur cône) et bonbon au cacao maigre 9% : graisses végétales (palmiste, palme), sucre, cacao maigre en poudre 0,9%, émulsifiant : lécithines (soja). Décor au cacao maigre 3% : graisses végétales (coprah, palmiste), sucre, cacao maigre en poudre 0,45%, émulsifiant : lécithines (soja). Morceaux de nougatine 3% : sucre, amandes 0,9%. Traces d\'autres fruits à coque. Les pourcentages sont exprimés sur le produit total.', 'https://static.openfoodfacts.org/images/products/356/470/012/5793/front_fr.12.400.jpg', '14', '11', '38', '28', '1.2', '3.8', '0.12', '0.047244094488189', '', '0');

