VALUES ('3564700127346', 'Smicy vanille', 'Glace à la vanille 41,8% : _lait_ écrémé reconstitué, sirop de glucose-fructose, concentré de protéines de _lactosérum_, graisse de coprah, sucre, eau, arômes naturels de vanille, émulsifiant : E471, stabilisants : farine de graines de caroube, gomme guar, carraghénanes, gousses de vanille épuisées et broyées, colorants : rocou, caroténoïdes, curcumine, arôme naturel. Glace à la vanille 26,9% : _lait_ écrémé reconstitué, sirop de glucose-fructose, concentré de protéines de _lactosérum_, eau, graisse de coprah, sucre, arôme naturel de vanille, émulsifiant : E471, stabilisants : farine de graine de caroube, gomme guar, carraghénanes, colorant : rocou. Cornet biscuit 16,4% : farine de _blé_, sucre, graisse de coprah, émulsifiant : lécithines (_soja_). Chemise (intérieur cône) et bonbon au cacao maigre 8,9% : graisses végétales (palmiste, palme), sucre, cacao maigre en poudre 0,89%, émulsifiant : lécithines (_soja_). Décor au cacao maigre 3% : graisses végétales (coco, palmiste), sucre, cacao maigre en poudre 0,45%, émulsifiant : lécithines (_soja_). Morceaux de nougatine 3% : sucre, _amandes_ 0,9%.', 'https://static.openfoodfacts.org/images/products/356/470/012/7346/front_fr.18.400.jpg', '14', '11', '41', '30', '0.7', '3.6', '0.13', '0.0511811023622047', '', '0');

