VALUES ('3564700127407', 'Citron Framboise', 'Glace au citron 38,1% : eau : jus de citron à base de concentré 18% ; sirop de glucose-fructose ; _lactose_ et protéines de _lait_ ; _lait_ écrémé reconstitué ; sucre ; _crème_ fraîche ; stabilisants : gomme guar, farine de graines de caroube, pectines, carraghénanes ; émulsifiant : E471 ; dextrose ; arôme naturel ; protéines de pois hydrolysées (pois, sucre) ; arôme naturel d\'orange. (% exprimé sur la glace au citron). Sorbet à la framboise 26,3% : eau ; purée de framboise 32% : sirop de glucose-fructose ; sucre ; stabilisants : gomme guar, farine de grains de caroube, pectines ; arôme naturel de framboise ; colorant : anthocyanes ; protéines de pois hydrolysée (pois, sucre) ; dextrose. ((% exprimé sur le sorbet à la framboise). Cornet biscuit 14,5% : farine de _blé_, sucre, graisse végétale de coprah, émulsifiant : lécithines (_soja_). Sauce aux fruits rouge (crayon et décor) 13,2% : sirop de glucose-fructose ; sucre ; purée de framboise à base de concentré 19% ; purée de fraise à base de concentré 10% ; eau ; purée de groseille 5% ; amidon de tapioca ; stabilisant : pectines ; correcteurs d\'acidité : acide citrique, E331 ; arôme naturel ; colorant : anthocyanes (% exprimé sur la sauce). Chemisage (intérieur cône) au cacao maigre 7,9% : graisses végétales (palmiste, palme), sucre, cacao maigre en poudre 10%, émulsifiant : lécithines (_soja_). (% exprimé sur le chemisage).', 'https://static.openfoodfacts.org/images/products/356/470/012/7407/front_fr.8.400.jpg', '5.9', '4', '40.2', '29.7', '1.1', '2.1', '0.1', '0.0393700787401575', '', '0');

