VALUES ('3564700335710', 'Mini Cônes avec éclats de noisettes saveur chocolat et saveur vanille', 'Mini cônes à la vanille (6 x 17,5 : Glace à la vanille 61,9% : lait écrémé reconstitué ; eau ; sucre ; graisses végétales (coco, palme) ; lactose et protéines de lait ; sirop de glucose ; émulsifiant : E471 ; stabilisants : gomme guar, alénate de sodium ; arôme naturel de vanille ; colorant : caroténoïdes. Cornet biscuit 22,1% : farine de blé, sucre, graisse de palme, émulsifiant : lécithines (soja), sel, colorant : caramel ordinaire. Chemisage (intérieur cône) et décor au cacao maigre 12,7% : huiles et graisses végétales en proportions variables (coco, palme, tournesol), sucre, cacao maigre en poudre 1,2%, émulsifiant : lécithines (soja), arôme naturel de vanille. Morceaux de noisettes au sucre 3,3% : noisettes 1,65%, sucre 1,65%. Mini cônes au chocolat (6 x 17,5 g) : Glace au chocolat 61,9% : lait écrémé reconstitué ; eau ; sucre ; graisses végétales (coco, palme) ; lactose et protéines de lait ; sirop de glucose ; chocolat noir 2,2% (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithines (soja)) ; cacao maigre en poudre ; émulsifiant : E471 ; stabilisants : gomme guar, alginate de sodium ; arôme naturel de cacao ; arôme naturel. Cornet biscuit 22,1% : farine de blé, sucre, graisse de palme, émulsifiant : lécithines (soja), sel, colorant : caramel ordinaire. Chemisage (intérieur cône) et décor au cacao maigre 12,7% : huiles et graisses végétales en proportions variables (coco, palme, tournesol), sucre, cacao maigre en poudre 1,2%, émulsifiant : lécithines (soja), arôme naturel de vanille. Morceaux de noisettes au sucre 3,3% : noisettes sucre 1,65%. Les pourcentages sont exprimés sur chaque mini cône.', 'https://static.openfoodfacts.org/images/products/356/470/033/5710/front_fr.5.400.jpg', '17', '11', '41', '25', '1.3', '3.5', '0.14', '0.0551181102362205', '', '1');

