VALUES ('3564700381830', 'Chips Pom\'lisse aromatisees', 'DE CHIPS DE POMMES DE TERRE AROMATISÉES INGRÉDIENTS Chips de pommes de terre saveur barbecue : Pommes de terre ; huile de tournesol 34 % ; assaisonnement saveur barbecue [saccharose, sucre glace, épices et plante aromatique, chapelure (farine de blé, sel, poudre à lever : E503), arômes naturels, tomate en poudre, colorant : extrait de paprika, sel, viande de bœuf déshydratée] ; sel. Traces de moutarde, lait et céleri. Chips de pommes de terre saveur poulet rôti : Pommes de terre ; huile de tournesol 34 % ; assaisonnement saveur poulet rôti [maltodextrine, extrait de levure, sucre, oignon en poudre, sel, ail en poudre, extrait de malt d\'orge (dont gluten), arômes naturels, bouillon de poulet déshydraté (peau de poulet cuit, viande cuite de poulet, sel), extrait de curcuma, graisse de poulet, colorant : extrait de paprika) ; sel. Traces de moutarde, lait et céleri. Saveur Bolognaise Chips de pommes de terre saveur bolognaise : Pommes de terre ; huile de tournesol 34 % assaisonnement saveur bolognaise [chapelure (farine de blé, sel, eau, poudre à lever : E503), dextrose, sucre, oignon en poudre 0,6 %, arômes et arôme de fumée (dont gluten et céleri), tomate en poudre 0,4%, plantes aromatiques déshydratées 0,3 % (origan, persil), extrait de levure, levure en poudre, ail en poudre, Colorant : extrait de paprika, poivre noir, extrait de thym] ; sel. Traces de moutarde et de lait.', 'https://static.openfoodfacts.org/images/products/356/470/038/1830/front_fr.6.400.jpg', '34', '3.1', '51', '5', '4.5', '6', '1.4', '0.551181102362205', '', '0');

