INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700414149', 'Mini tartelettes x24', '6 MINI TARTELETTES FAÇON PIZZA PRÉCUITES SURGELÉES 26,4% :  Garniture 54%* : oignon 23,7%*, olive noire dénoyautée 13,7%* (olive, eau, sel, stabilisant : E579), double concentré de tomate 9,5%*, eau, _emmental_ râpé, _parmesan_ râpé, amidon modifié de pomme de terre, sel, arôme naturel, persil. Pâte brisée 46%* : farine de _blé_ ; margarine (matières grasses et huiles végétales (palme, coprah et colza) , eau , émulsifiant : E471, correcteur d\'acidité : acide citrique) ; eau ; amidon de _blé_ ; huile de tournesol ; sel ; _lactosérum_ et protéines de _lait_ ; sucre ; poudres à lever : E450, E500 (contient du _blé_). TARTELETTES FAÇON QUICHE LORRAINE PRÉCUITES SURGELÉES 26,2% : Pâte brisée 52,5%* : farine de _blé_ ; margarine (matières grasses et huiles végétales (palme, coprah et colza), eau, émulsifiant : E471, correcteur d\'acidité : acide citrique) ; eau ; amidon de _blé_ ; huile de tournesol ; sel ; _lactosérum_ et protéines de _lait_ ; sucre ; poudres à lever : E450, E500 (contient du _blé_).  Garniture 47,5%* : eau, _œuf_ entier 10,8%*, lardon fumé cuit goût fumé 7,4%* (poitrine de porc, sel, dextrose, arôme de fumée, correcteur d\'acidité : acide citrique, antioxydant : E316, conservateur : E250), jambon fumé cuit standard goût fumé 7,4%* (jambon de porc ; eau ; dextrose ; sirop de glucose ; protéines de sang ; sel ; stabilisants : E450, E451 ; arômes ; arôme de fumée ; gélifiants : carraghénanes, farine de graines de caroube, gomme xanthane ; antioxydant : ascorbate de sodium ; conservateur : E250), _lait_ écrémé en poudre, amidon modifié de pomme de terre, arôme (contient du _blé_ et du _lait_), sel, arôme naturel de poivre.  6 MINI-TARTELETTES AU SAUMON ET A L\'OSEILLE PRÉCUITES SURGELÉES 23,9% : Pâte brisée 57%* : farine de _blé_ ; margarine (matières grasses et huiles végétales (palme, coprah et colza), eau, émulsifiant : E471, correcteur d\'acidité , acide citrique) ; eau ; amidon de _blé_ ; huile de tournesol ; sel ; _lactosérum_ et protéines de _lait_ ; sucre ; poudres à lever : E450, E500 (contient du _blé_).  Garniture 43%* : eau, _crème_ (_crème_, stabilisant : carraghénanes), miettes de _saumon_ cuit 7,7% (_saumon_ atlantique - Salmo salar, sel), œuf entier, oseille 3,6%*, amidon modifié de pomme de terre, _lait_ écrémé en poudre, fumets aromatisés de _poissons_ (sel, dextrose, arômes naturels (contient des _mollusques_), maltodextrines, _poissons_, _poissons_ déshydratés, _crevette_, carotte, arôme, arôme naturel de poireau, fécule de pomme de terre, poivre et plantes aromatiques (contient du _céleri_), correcteur d\'acidité : acide citrique), madère modifié (vin de Madère, sel, arôme naturel), purée concentrée de citron (jus concentré de citron, correcteur d\'acidité : acide citrique, eau, pulpe de citron, sucre, citron), sel, arôme naturel de poivre.  6 MINI-TARTELETTES AUX 2 FROMAGES PRÉCUITES SURGELÉES 23,4% : Pâte brisée 58,5%* : farine de _blé_ ; margarine (matières grasses et huiles végétales (palme, coprah et colza), eau, émulsifiant : E471, correcteur d\'acidité : acide citrique) ; eau ; amidon de _blé_ ; huile de tournesol ; sel ; _lactosérum_ et protéines de _lait_ ; sucre ; poudres à lever ;E450, E500 (contient du _blé_).  Garniture 41,5%* , eau, _emmental_ râpé 14,2%*, _œuf_ entier, _lait_ écrémé en poudre, amidon modifié de pomme de terre, _parmesan_ râpé 1,1%*, sel, arôme naturel de poivre.  * Pourcentages exprimés sur chaque Mini-Tartelette. ', 'https://static.openfoodfacts.org/images/products/356/470/041/4149/front_fr.14.400.jpg', '16.2', '7.2', '31.5', '2.9', '1.4', '7.1', '1.39', '0.547244094488189', '', '0');

