VALUES ('3564700425268', 'Menthe Chocolat', 'Glace à la menthe 29,6%: eau ; _lait_ écrémé reconstitué ; _lactose_ et protéines de _lait_ ; sucre ; graisse végétale de coprah ; sirop de glucose-fructose ; émulsifiant : E471 ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes ; colorants : E141, curcumine ; arôme naturel de menthe. Glace au chocolat 29,6% : _lait_ écrémé reconstitué ; sucre ; graisse végétale de coprah ; chocolat 1,1% (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithines (_soja_)) ; cacao maigre en poudre ; _lait_ écrémé concentré ; sirop de glucose-fructose ; dextrose ; émulsifiant : E471 ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes. Cornet biscuit 15,5% : farine de blé, sucre, graisse végétale de coprah, émulsifiant : lécithines (_soja_). Sauce parfum chocolat 8,5% : eau, sirop de glucose-fructose, sucre, cacao maigre en poudre, amidon modifié de tapioca, chocolat 0,1% (pâte de cacao, sucre, cacao maigre en poudre), poudre de lait écrémé, sel. Chemisage (intérieur cône) au cacao maigre 7% : graisses végétales (palme, palmiste), sucre, cacao maigre en poudre 0,7%, émulsifiant : lécithines (_soja_). Pointe fourrée au cacao maigre et noisette 4,2 % : graisse végétale de coprah, sucre, cacao maigre en poudre 0,4%, pâte de _noisette_ 0,2%, émulsifiant : lécithines (_soja_), arômes naturels, sel. Décor au cacao maigre 2,8% : graisses végétales (coprah, palmiste), sucre, cacao maigre en poudre 0,4%, émulsifiant: lécithines (_soja_). Morceaux de chocolat (décor) 2,8% : sucre, pâte de cacao 1,3%, beurre de cacao, émulsifiant : lécithines (_soja_), arôme naturel de vanille.', 'https://static.openfoodfacts.org/images/products/356/470/042/5268/front_fr.5.400.jpg', '15.3', '12.3', '36.4', '27.4', '1.5', '3.6', '0.088', '0.0346456692913386', '', '0');

