VALUES ('3564700460016', 'Nems Tables du Monde Porc + sauce x12', '12 NEMS FARCIS AU PORC, ACCOMPAGNÉS DE SAUCES POUR NEMs INGRÉDIENTS 12 Galettes de riz farcies au porc (60 g par pièce) : eau, farine de riz, carotte, oignon, viande et gras de porc (origine : UE) 8,5%&quot;, huile de tournesol, protéines de soja, vermicelle (amidon de pois, amidon de maïs), champignon noir, sel, sauce poisson (poisson, sel, eau), menthe, sucre caramélisé (sucre, eau), poivre. *Pourcentage exprimé sur les nems. 3 sachets de sauce pour nems (40 g par sachet): eau, sucre, vinaigre d\'alcool, sel, nuoc-mâm 1,6%** (poisson, sel, eau), sauce soja (eau, graines de soja, sel, farine de blé). **Pourcentage exprimé sur la sauce. Traces de crustacés, lait, euf et arachide.', 'https://static.openfoodfacts.org/images/products/356/470/046/0016/front_fr.9.400.jpg', '8.6', '2.5', '21', '3.5', '2.1', '5.7', '1.8', '0.708661417322835', '', '0');

