VALUES ('3564700460023', '6 Nems au Porc et leur sauce ', 'Garniture 66 % : pousse de haricot mungo, gorge de porc 17 %, oignon, eau, carotte, gras de porc 8 %, morceau de tête de porc 8 %, vermicelle de pois, sucre, sel, fibre de blé, œuf, champignon noir sec, glutamate monosodique, épices, dextrose, gingembre. (Pourcentages exprimés sur la garniture). Galette de riz 34 % : eau, farine de riz, huile de tournesol et/ou colza, sucre caramélisé, arôme naturel de carotte ; 1 sachet de sauce pour nems 30 g : eau, sucre, sauce nuoc mam 8 % (anchois, sel), vinaigre d\'alcool, sel, E202. (Pourcentage exprimé sur la sauce)', 'https://static.openfoodfacts.org/images/products/356/470/046/0023/front_fr.7.400.jpg', '14', '4', '20', '4', '2.5', '4.5', '2.286', '0.9', '', '0');

